// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

/// Library imports
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Employee {

    enum EmployeeStatus {
		Active,
		Sold,
		Cancelled,
        Frozen
	}

    struct Employees {
        EmployeeStatus status;
        address seller;
        address token;
        uint256 tokenId;
        uint256 price;
        uint256 timeToUse;
    }

    mapping(uint256 => Employees) public employees;
    uint256 private employeesId = 0;

    function getEmployee(uint256 employeId) public view returns (Employees memory)  {
        return employees[employeId];
    }

    function setEmployee(address token, uint tokenId, uint price) external returns (address) {
        Employees memory employee = Employees(
            EmployeeStatus.Frozen,
            msg.sender,
            token,
            tokenId,
            price,
            (block.timestamp + (365 days))
        );

        ++employeesId;
        employees[employeesId] = employee;
        return token;
    }  
}
